#include "nsltools.h"

void nsltools_get_param(wav2aud_param_t *param, int argc, float *argv){
	

	switch(argc){
	case 4:
		param->shft = log2(argv[3]/16000.0);
		param->fac = argv[2];
		param->alpha = exp(-1/(argv[1] * pow(2, 4 + param->shft)));
		param->L_frm = round(argv[0] * pow(2, 4 + param->shft));
		break;
	case 3:
		param->shft = -0.415037;
		param->fac = argv[2];
		param->alpha = exp(-1/(argv[1] * pow(2, 4 + param->shft)));
		param->L_frm = round(argv[0] * pow(2, 4 + param->shft));
		break;	
	case 2:
		param->shft = -0.415037;
		param->fac = -2;
		param->alpha = exp(-1/(argv[1] * pow(2, 4 + param->shft)));
		param->L_frm = round(argv[0] * pow(2, 4 + param->shft));
		break;
	case 1:
		param->shft = -0.415037;
		param->fac = -2;
		param->alpha = exp(-1/(8.0 * pow(2, 4 + param->shft)));
		param->L_frm = round(argv[0] * pow(2, 4 + param->shft));
		break;		
	case 0:
		param->shft = -0.415037;
		param->fac = -2;
		param->alpha = exp(-1/(8.0 * pow(2, 4 + param->shft)));
		param->L_frm = round(8 * pow(2, 4 + param->shft));
	}
  	
	param->beta = exp(-1.0/(0.5 * pow(2, 4 + param->shft)));
	
		
}


