void nsltools_normalize_coef(double *vectorA, double *vectorB, int size,  double coef){
	
	int i;
	double max=0 ;
	
	if(coef!= 1){	
		for(i=0; i<size; i++){
			if(max < vectorA[i]) max = vectorA[i];
			else if(max < vectorB[i]) max = vectorB[i];
			}
		for(i=0; i<size; i++){ vectorA[i] = (vectorA[i]/max)*coef; vectorB[i] = (vectorB[i]/max)*coef;}
		}
}


// FILTER function like in MATAB, based on http://mechatronics.ece.usu.edu/yqchen/filter.c/FILTER.C   from    http://mechatronics.ece.usu.edu/yqchen/filter.c/    
void nsltools_filter(double *y, double *wav, double *B, double *A,  int size, int size_coef){ 
	
	int i,j;	
	
	nsltools_normalize_coef(A, B, size_coef, A[0]);
	
	y[0]=B[0]*wav[0];
	for (i=1;i<size_coef;i++){
	    y[i]=0.0;
	    for(j=0;j<i+1;j++)y[i]=y[i]+B[j]*wav[i-j];
	    for(j=0;j<i;j++) y[i]=y[i]-A[j+1]*y[i-j-1];
	}
	for (i=size_coef;i<size;i++){
		y[i]=0.0;
	    for (j=0;j<size_coef;j++)y[i]=y[i]+B[j]*wav[i-j];
	    for (j=0;j<size_coef-1;j++)y[i]=y[i]-A[j+1]*y[i-j-1];
	}
	
	
}

void nsltools_halfregu(double *y, int size){
	
	int i, L_dn = 0, L_up = 0, edge_dn, up_i = 0, accum;
	int *dy, *edge_up; 
	
	dy = (int *)malloc((size-1)* sizeof(int));
	
	for(i=0; i<size; i++) 
		y[i] = (y[i] > 0);
	for(i=1; i<size-1; i++){
		dy[i] = (int)(y[i]-y[i-1]);
		if(dy[i] == 1){
			L_up++;

		}else 
			if(dy[i] == -1){
				L_dn++;
				dy[i] = 0;

			}
	}
	
	if(L_dn * L_up){
		if(y[0] == 0){
			edge_up = (int *)malloc((L_up+1)* sizeof(int));
			edge_up[L_up] = size;
			
			for(i=0; i < size-1; i++){
				if(dy[i] == 1){
					edge_up[up_i] = i;
					up_i++;
				}
			}
			for(i=0; i < L_dn; i++){
				edge_dn = round((edge_up[i] + edge_up[i+1])/2.0);
				dy[edge_dn] = dy[edge_dn] -1;
			}
			y[0]=0;
			accum =0;
			for(i=1; i < size; i++){
				accum = accum + dy[i];
				y[i]= accum;
			}
			free(edge_up);		
			
		}else {
			edge_up = (int *)malloc((L_up+2)* sizeof(int));
			edge_up[0] = 0;
			edge_up[L_up+1] = size;
			
			for(i=0; i < size-1; i++){
				if(dy[i] == 1){
					edge_up[up_i] = i;
					up_i++;
				}
			}
			for(i=0; i < L_dn; i++){
				edge_dn = round((edge_up[i] + edge_up[i+1])/2.0);
				dy[edge_dn] = dy[edge_dn] -1;
			}
			y[0]=1;
			accum = 1;
			for(i=1; i < size; i++){
				accum = accum + dy[i];
				y[i]= accum;
			}
			free(edge_up);
		}
	}
	free(dy);
}

// sigmoid function simulating the ionnic channels'nonlinar compression 
void nsltools_sigmoid(double *y1, float fac, int size){ 
	
	int i;
	
	if(fac > 0) 
		for(i=0;i<size;i++) 
			y1[i] = 1.0/(1+exp(-y1[i]/(double)fac));
	else if(fac == 0) 
		for (i=0;i<size;i++)y1[i]= y1[i]>0;
	else if(fac == -1) 
		for (i=0;i<size;i++)if(y1[i]<0)y1[i]=0;
	else if(fac == -3)
		nsltools_halfregu(y1, size);
		
	
}


void nsltools_wav2aud(float *v5, double *wav, int size, int N_frames, wav2aud_param_t param){
	
	
	int ch,i,j,index, frame;
	double avg, pos;
	double coefA[2]={1, -param.beta}, coefB[2]={1, 0}, coefA2[2]={1, -param.alpha};
	double *real, *imag,*y1, *y1_h, *y2, *y3, *pivot; 
	
	y1 = (double *)malloc(size*sizeof(double));
	y2 = (double *)malloc(size*sizeof(double));
	y3 = (double *)malloc(size*sizeof(double));

		
/****************** LAST CHANNEL ******************************************/
// calculated for subtraction in lateral network stage
	
	pos = COCHBA('r', 0, M-1)+1;
	real = (double *)malloc(pos*sizeof(double));
	imag = (double *)malloc(pos*sizeof(double));
		
	for(i=0; i < pos; i++) real[i] = COCHBA('r', 1+i, M-1); 
	for(i=0; i < pos; i++) imag[i] = COCHBA('i', 1+i, M-1); 
	
	nsltools_filter(y1, wav, real, imag, size, pos);
	nsltools_sigmoid(y1, param.fac,size);
	
	if(param.fac != -2){
		 y1_h = (double *)malloc(size*sizeof(double));
		 nsltools_filter(y1_h, y1, coefB, coefA, size,2);
		 free(y1);
		 y1 = y1_h;
	 }
	
	free(real);
	free(imag);	
	
	
/******************  OTHER CHANNELS	************************************/


	/******** ANALYSIS STAGE: cochelar filter bank ************/
	
	for(ch = M-2; ch >= 0; ch--){
		pos = COCHBA('r',0, ch)+1; // order of ARMA
		real = (double *)malloc(pos*sizeof(double)); // moving average coefficients
		imag = (double *)malloc(pos*sizeof(double)); // autoregressive coefficients
		
		for(i=0; i < pos; i++) real[i] = COCHBA('r', i+1, ch); 
		for(i=0; i < pos; i++) imag[i] = COCHBA('i', i+1, ch); 
			
		nsltools_filter(y2, wav, real, imag, size, pos);
		
	/********	TRANSDUCTION STAGE: haircells ****************/
		
		//ionnic channels
		nsltools_sigmoid(y2,param.fac,size);
		
		// hair cell membrane - lowpass-  <= 4 hz - ignored for linear
		if(param.fac != -2){
			nsltools_filter(y3, y2, coefB, coefA, size, 2);
			
	/********** REDUCTION STAGE: Lateral Inibition Network *******/
			
			// masked by higher (frequency) spacial response
			for(i=0; i<size; i++) y3[i] = y3[i]-y1[i];			
		}else{
			for(i=0; i<size; i++) y3[i] = y2[i]-y1[i];
		}
				
		// halfwave rectifier
		for(i=0; i<size; i++) if(y3[i] < 0.0) y3[i]=0;
				
		//temporal integration window
		if(param.alpha){ // leaky integration
			nsltools_filter(y1, y3, coefB, coefA2, size, 2);
			for(i=0; i < N_frames; i++){
				index = (int)((i+1)*param.L_frm)-1;
				frame = (int)(i*(M-1));
				v5[frame+ch] = (float)(y1[index]);
				}
			}
		// short-term average
		else if(param.L_frm ==1){
			for(i=0; i < N_frames; i++){
				frame = (int)((M-1)*i);
				v5[frame+ch] = y3[i];
			}
		}
		else{
			for(i=0; i < N_frames; i++){
				frame = (int)(i*(M-1));
				avg = 0;
				for(j=0; j< param.L_frm;j++){
					index = (int)(i*param.L_frm)+j;
					avg = avg + y3[index];
					avg = avg/param.L_frm;
					}
					v5[frame + ch] = avg;
				}
		    }
		//rotating buffers pointers to save data in y2 as anterior channel to subtraction in the iteration.
		pivot = y1;
		y1 = y2;
		y2 = pivot;		
		free(real);
		free(imag);
			
		}
	
	free(y1);
	free(y2);
	free(y3);

	
}


